import React from "react";

function Footer() {
  return (
    <footer class="footer">
      <div class="container d-flex justify-content-center">
        <span class="text-light">&copy; Copyright 2021 Matache Marius</span>
      </div>
    </footer>
  );
}

export default Footer;
